CREATE DEFINER=`root`@`localhost` FUNCTION `dist_between_points`(LATITUD_1 float, LONGITUD_1 float, LATITUD_2 float, LONGITUD_2 float, Units varchar(15)) RETURNS float
BEGIN

/*Si quieres el resultado el millas
cambia el valor 6371 en la funci√≥n
por 3959*/

if Units='MILLE' then
		return (
	(acos(sin(radians(LATITUD_1)) * sin(radians(LATITUD_2)) + 
	cos(radians(LATITUD_1)) * cos(radians(LATITUD_2)) * 
	cos(radians(LONGITUD_1) - radians(LONGITUD_2))) * 3959) );
else
		return (
	(acos(sin(radians(LATITUD_1)) * sin(radians(LATITUD_2)) + 
	cos(radians(LATITUD_1)) * cos(radians(LATITUD_2)) * 
	cos(radians(LONGITUD_1) - radians(LONGITUD_2))) * 6371) );
end if;
END ;;
